import styled from 'styled-components';
import theme from '../../theme';

export const Container = styled.div`
  cursor: pointer;
  padding: 12px 40px;
  background: ${theme.color.primary};
  border-radius: 10px;
`;

export const Text = styled.span`
  font-size: 14px;
  color: ${theme.color.white};
  font-weight: 600;
  text-align: center;
  width: 20px;
`;
